  `open_default` tinyint(1) NOT NULL default '1' COMMENT '其他地区是否启用默认费用 1启用 0 不启用',
  `is_delete` tinyint(1) NOT NULL default '0' COMMENT '是否删除 0:未删除 1:删除',
  PRIMARY KEY  (`id`),
  index (`status`),
  index (`sort`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='配送方式表';

